/*Table structure for table `azp_menu_crud` */

DROP TABLE IF EXISTS `azp_menu_crud`;

CREATE TABLE `azp_menu_crud` (
  `id_azp_menu_crud` bigint(255) NOT NULL AUTO_INCREMENT,
  `m_by_created` bigint(255) DEFAULT NULL COMMENT 'Creado Por',
  `m_by_modified` bigint(255) DEFAULT NULL COMMENT 'Modificado Por',
  `m_date_created` datetime NOT NULL COMMENT 'Fecha Creado',
  `m_date_modified` datetime NOT NULL COMMENT 'Fecha Modificado',
  `m_deleted` tinyint(1) NOT NULL COMMENT 'Eliminado',
  `m_description` longtext COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Descripcion',
  `m_level` tinyint(1) NOT NULL COMMENT 'Nivel',
  `m_status` tinyint(1) NOT NULL COMMENT 'Estado',
  `m_temp` tinyint(1) NOT NULL COMMENT 'Temporal',
  `t_api` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Api',
  `t_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Nombre',
  `t_script` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Script',
  `t_table_change` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Tabla Cambios',
  `t_table_main` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Tabla Principal',
  `t_url` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Url',
  `v_id_azp_application` bigint(255) DEFAULT NULL COMMENT 'Id',
  `v_id_azp_icon_code` bigint(255) DEFAULT NULL COMMENT 'Id',
  `v_id_azp_table_prefix` bigint(255) DEFAULT NULL COMMENT 'Id',
  PRIMARY KEY (`id_azp_menu_crud`),
  KEY `IDX_id_azp_menu_crud` (`id_azp_menu_crud`),
  KEY `IDX_m_by_created` (`m_by_created`),
  KEY `IDX_m_by_modified` (`m_by_modified`),
  KEY `IDX_m_date_created` (`m_date_created`),
  KEY `IDX_m_date_modified` (`m_date_modified`),
  KEY `IDX_m_deleted` (`m_deleted`),
  KEY `IDX_m_description` (`m_description`(1024)),
  KEY `IDX_m_level` (`m_level`),
  KEY `IDX_m_status` (`m_status`),
  KEY `IDX_m_temp` (`m_temp`),
  KEY `IDX_t_name` (`t_name`),
  KEY `IDX_t_script` (`t_script`),
  KEY `IDX_t_table_change` (`t_table_change`),
  KEY `IDX_t_table_main` (`t_table_main`),
  KEY `IDX_t_url` (`t_url`),
  KEY `IDX_v_id_azp_application` (`v_id_azp_application`),
  KEY `IDX_v_id_azp_icon_code` (`v_id_azp_icon_code`),
  KEY `IDX_v_id_azp_table_prefix` (`v_id_azp_table_prefix`),
  CONSTRAINT `azp_menu_crud_ibfk_1` FOREIGN KEY (`v_id_azp_application`) REFERENCES `azp_application` (`id_azp_application`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `azp_menu_crud_ibfk_2` FOREIGN KEY (`v_id_azp_icon_code`) REFERENCES `azp_icon_code` (`id_azp_icon_code`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `azp_menu_crud_ibfk_3` FOREIGN KEY (`v_id_azp_table_prefix`) REFERENCES `azp_table_prefix` (`id_azp_table_prefix`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=90 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

